import React from 'react';
import './Board.css';

const ChampionDisplay = () => {
  return (
    <div style={{ marginTop: '10px', marginBottom: '10px', paddingTop: '10px', paddingBottom: '10px' }}>
      <h2 style={{ color: '#ffffff', textAlign: 'center', marginBottom: '5px', marginTop: '5px', fontSize: '20px' }}>Tahm Kench</h2>
      <div style={{ textAlign: 'center' }}>
        <span style={{ color: 'yellow' }}>★ ★ ★</span>
      </div>
      <div style={{ padding: '5px' }}>
        <img src='https://cdn.dak.gg/tft/images2/sets/set10/portraits/TahmKench.jpg' alt="tahm-kench" style={{ width: '100%' }} />
      </div>
    </div>
  );
};

export default ChampionDisplay;
